#include <iostream>
#define ALTO 100
#define ANCHO 100
#define N 100
#define M 100
using namespace std;

void porcentaje(const char m1[N][M]){
	
	int cantBlancos=0;
	
	for(int i=0; i<100; i++){
		for(int j=i; j<100; j++){
			
			if(m1[i][j]==' '){
				cantBlancos++;
			}
			
		}
	}
	
	int area=(N*M)/2;
	
	float porcentaje=(float(cantBlancos)/area)*100;
	cout<< porcentaje<<endl;
}

void quitarRecuadro(char mat[ALTO][ANCHO],int anchoRecuadro){
	for (int i = anchoRecuadro; i < ALTO-anchoRecuadro; i++) {
		for (int j = anchoRecuadro; j < ANCHO-anchoRecuadro; j++) {
			cout << mat[i][j];
		}
		cout << endl;
		
	}
}

void Imprimir(char mat[ALTO][ANCHO]) {
	
	for (int i = 0; i < ALTO; i++) {
		for (int j = 0; j < ANCHO; j++) {
			cout << mat[i][j];
		}
		cout << endl;
		
	}
	
}

void recortar(char mat[ALTO][ANCHO]){
	int ancho, alto, puntoI, puntoJ;
	cout <<"Ingrese el punto de inicio: ";
	cin>> puntoI >> puntoJ;
	cout<<"Ingrese ANCHO y ALTO: ";
	cin >> ancho >> alto;
	
	
	for(int i= puntoI ;i< puntoI + alto ;i++) { 
		for(int j=puntoJ;j<puntoJ+ancho;j++) { 
			cout << mat[i][j];
		}
		cout <<endl;
	}
}

